def bubble(list_):
    for i in range(len(list_)):
        for y in range(len(list_)-1-i):
            if list_[y]>list_[y+1]:
                temp = list_[y]
                list_[y] = list_[y+1]
                list_[y+1] = temp

def search(list_, goal):
    mid = len(list_)//2
    max_ = len(list_)
    min_ = 0
    while min_ != max_:
        if goal<list_[mid]:
            max_ = mid - 1
            mid = ((max_ - min_) //2) + min_
        else:
            min_ = mid +1
            mid = min_ + ((max_ - min_) // 2)
    if list_[mid - 1] == goal: 
        return mid
    else:
        return False
